import React, { Component } from 'react'

export class Navbar extends Component {
    render() {
        return (
            <Navbar expand="lg" variant="dark" style={{ backgroundColor: '#4b6777' }}>
            <Container>
              <Navbar.Brand href="#home" style={{ fontFamily: 'fantasy', fontSize: '24px' }}>UniqueNavbar</Navbar.Brand>
              <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="ml-auto">
                  <Nav.Link href="#home" style={{ fontFamily: 'Arial', fontSize: '18px', color: '#e1e6e1' }}>Home</Nav.Link>
                  <Nav.Link href="#about" style={{ fontFamily: 'Arial', fontSize: '18px', color: '#e1e6e1' }}>About</Nav.Link>
                  <Nav.Link href="#services" style={{ fontFamily: 'Arial', fontSize: '18px', color: '#e1e6e1' }}>Services</Nav.Link>
                  <Nav.Link href="#contact" style={{ fontFamily: 'Arial', fontSize: '18px', color: '#e1e6e1' }}>Contact</Nav.Link>
                </Nav>
              </Navbar.Collapse>
            </Container>
          </Navbar>
        )

    }
}

export default Navbar;
